import ArtImageTile from '../ArtImageTile'
import { useParams, Route, Switch } from 'react-router-dom';

function GalleryView({ galleries }) {
    let { id } = useParams();
    let gallery = galleries.find((gallery) => gallery.gallerynumber === id);
    console.log(gallery);

    return (
        <Switch>
            <Route exact path={`/galleries/${id}`}>
                <h1>{gallery.name}</h1>
                {
                    gallery.objects.map((object) => {
                        return (
                            <ArtImageTile galleryId={id} object={object} />
                        )
                    })
                }
            </Route>
        </Switch>


    );
}

export default GalleryView;
